import React from 'react';

const Single = ({key, que}) => {
	const data = JSON.parse(sessionStorage.getItem(que));
	const options = data.options;

	return (
		// <div key={`${que}_${key}`}>
		// 	<div>{que}</div>
		// 	{options.map(option => (
		// 		<div key={key} id={option.id}>
		// 			{option.id}.{'\t'}{option.content}
		// 		</div>
		// 	))}
		// </div>
		<fieldset disabled>
			<legend>{que}</legend>
			{options.map(option => (
				<div key={key} id={option.id}>
					<input type={"radio"} value={option.content}></input>
					<label htmlFor={option.content}>{option.content}</label>
				</div>
			))}
		</fieldset>
	);
};

export default Single;
